:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Thomas Coldham and BEETHAM, Anne Palmer (Annie)
  JWILLIAMS, Hugh George and JONES, Helen
  JWILLIAMS, Garthowen and ALISON, Audrey May
  01> WILLIAMS, Garthowen m on 08.12.1968 to (2)ALISON, Audrey May
  b 26.09.1906 d 28.07.1975
  b 13.06.1910
  Garth m., d. and bd. at Nairobi. Audrey, d/o Ewen Alison Jnr and Winifred Reed, b. at Auckland. Address:
  Flat 7, 7 Egerton Gardens, London Sw3, England.
  02> WILLIAMS, Morvyn (Tim) m on 27.04.1938 to RIDDIFORD, Philippa Therese
  b 29.01.1910 d 15.04.1989
  b 21.11.1916 d 11.09.1994
  Tim b. at Masterton and d. at Wellington, Philippa, d/o Daniel Henry Strother Riddiford, MC (of Longwood,
  Featherston) and Jessie Meta Johnston (d/o Sydney Johnston of Orua Wharo, Takapau), b. at London, England.
  Address: 36 Central Terrace, Kelburn, Wellington.
  Tim was educated at Croydon School, Wellington, Christ's College, Christchurch, Jesus College, Cambridge
  (MA, MB, BCh) and St George's Hospital, London (1934-36 , MRCP 1935). He was captain of the Jesus College
  rugby team and played for St George's Hospital, and London Welsh teams.
  During WW2 Tim served in the NZEF, Middle East (1939-43) and in the Pacific Force (1943-44). Following the
  war Tim was Wellington Hospital Senior Physician (1945-75).
  He was a Foundation Fellow Royal Australasian College of Physicians (1938); FRCP (1959); President RACP
  (1964); a Fellow of the American College of Physicians; Chairman of Joint Committee on Medical Graduate
  Needs (subsequently known as the Williams Report) (1968-69); a Director of Wellington Publishing Co
  (1959-72); a Director of Independent Newspapers Ltd (1972-79); and Chairman of INL (1973-76).
  Tim inherited "Kumukumu" station, Masterton, from his father, and later purchased his brother's share of
  the property. He then extended the farming operation by purchasing "Ngatawhai" station.
  Philippa served on the National Executive of the Girl Guides Association from 1965 and was International
  Commissioner (1970-80). She also served on the Wellington Board of the YWCA (1960-65) and the Board of
  Governors of Erskine College (1969-76).
  01> WILLIAMS, Sarah Marianne m on 28.11.1970 to LARKIN, Thomas Cedric
  b 07.06.1939
  b 17.11.1917
  Sarah b. at Wellington and m, at Featherston. Thomas, s/o Herbert James Larkin and Irene Mary O'Connor,
  b. at Wellington. Address: 39 Upland Road, Wellington.
  Thomas worked in the Department of Foreign Affairs and served as New Zealand Ambassador to Japan from
  1971-76.
  01> LARKIN, Tom
  b 18.09.1971
  02> LARKIN, Adam
  b 01.09.1973
  03> LARKIN, Daisy
  b 04.07.1977
  02> WILLIAMS, Antonia Helen m on 21.10.1976 to BOWERING, John
  b 27.08.1940
  b 23.12.1943
  Antonia m. at London, England. She is known by the names Antonia Williams, John b. at Swindon, United
  Kingdom. Address: 261 Darley Road, Randwick 2031, NSW, Australia.
  Antonia graduated DipFA(Hons) from the University of Canterbury in 1962 and in 1963 she was assistant
  art editor of New Zealand School Publications. She moved to London in 1964 and in 1966 she won the
  Vogue/House and Garden talent contest in London. During 1966-88 she was a writer and editor including
  Associate Editor of "Vogue UK" (1978). From the spring of 1986 to the autumn/winter of 1988-89, she
  collaborated on the Issey Miyake/Snowdon Permanente Project before moving to Sydney, Australia in 1989.
  She was Features Editor of "Vogue Living" in Sydney in 1991-92 and in 1993 she was a Sydney-based
  freelance writer and lifestyle critic. Since 1996 she has been a contributor and auction columnist
  with the "Sydney Morning Herald". She is a contributing editor to "Inside" (interior review), a
  contributing editor design to "Vogue Entertaining" and a consulting editor to "Appetite".
